import { View, Text, Pressable, ScrollView, Button } from "react-native";
import React, { useContext, useEffect, useState } from "react";
import { Entypo, Ionicons } from "react-native-vector-icons";
import FontAwesomeIcons from "react-native-vector-icons/FontAwesome5";
import axiosInstance from "../configs/axiosInstance";
import AsyncStorage from "@react-native-async-storage/async-storage";
import io from 'socket.io-client';

const PersonalSetting = ({ navigation }) => {

  const [storedDataAccessToken, setStoredDataAccessToken] = useState(null);
  const [storedDataRefreshToken, setStoredDataRefreshToken] = useState(null);
  const socket = io('/api/auth/logout')

  useEffect(() => {
    navigation.setOptions({
      headerRight: () => (
        <View style={{ flexDirection: "row", paddingHorizontal: 16 }}>
          <Pressable style={{ paddingHorizontal: 2 }}>
            <Ionicons name="search" size={24} color="white" />
          </Pressable>
        </View>
      ),
      headerTitle: () => (
        <View style={{ flexDirection: "row", alignItems: "center" }}>
          <Text style={{ color: "white", fontSize: 20, fontWeight: "bold" }}>
            Cài đặt
          </Text>
        </View>
      ),
      headerStyle: {
        backgroundColor: "#0091FF",
        shadowColor: "#fff",
      },
      headerTintColor: "#fff",
      headerTitleStyle: {
        fontSize: 20,
      },
    });
  }, [navigation]);

  const handleLogout = async () => {

    // Hàm lưu dữ liệu vào AsyncStorage
    try {
      await AsyncStorage.setItem('accessToken', "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJkZXZpY2VfaWQiOiJhYmNkIiwidXNlcl9pZCI6IjY1ZjAzNGEzZGQ3Y2EzOTYwZWZiZmFmOSIsInBob25lIjoiMDMzODAzMDU0OSIsImlhdCI6MTcxMDI5OTM2NCwiZXhwIjoxNzEwMjk5OTY0fQ.EqVcnBB7lRxXWJuRTrX9MwzgetdDE48EpoTTWXtBzR8");
      await AsyncStorage.setItem('refreshToken', "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJkZXZpY2VfaWQiOiJhYmNkIiwidXNlcl9pZCI6IjY1ZjAzNGEzZGQ3Y2EzOTYwZWZiZmFmOSIsInBob25lIjoiMDMzODAzMDU0OSIsImlhdCI6MTcxMDI2NDI0MiwiZXhwIjoxNzEyODU2MjQyfQ.X3xOrUSRasmJfsY1-K3ulCwMpQqNLoEVHQhdOEQT_-8");
      alert('Dữ liệu đã được lưu vào LocalStorage.');
    } catch (error) {
      alert('Đã xảy ra lỗi khi lưu dữ liệu vào LocalStorage.');
    }

    try {
      // Kiểm tra token
      const accessToken = await AsyncStorage.getItem('accessToken');
      const refreshToken = await AsyncStorage.getItem('refreshToken');
      if (!accessToken || !refreshToken) {
        console.error('Không tìm thấy token');
        return;
      }

      // Gửi yêu cầu logout tới server
      const response = await axiosInstance.post("/api/auth/logout", null, {
        headers: {
          'Authorization': `Bearer ${accessToken}`
        }
      });

      // Kiểm tra trạng thái của response
      if (response.status === 200) {

        await AsyncStorage.removeItem('accessToken');
        await AsyncStorage.removeItem('refreshToken');


        socket.on('focus_logout', () => {
          navigation.navigate('Login')
        })

      } else {
        // Xử lý lỗi ở đây
        console.error('Logout không thành công');
      }

    } catch (error) {
      // Xử lý lỗi mạng hoặc lỗi khác
      console.error('Đã xảy ra lỗi khi thực hiện logout:', error);
    }

  };


  return (
    <View>
      <ScrollView>
        <Pressable
          onPress={() => {
            navigation.navigate("AccountVsSecurity");
          }}
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="shield-checkmark-outline" size={22} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Tài khoản và bảo mật</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Quyền riêng tư */}
        <Pressable
          onPress={() => {
            navigation.navigate("PersonalPrivacy");
          }}
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
            marginBottom: 2,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="lock-closed-outline" size={22} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Quyền riêng tư</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Dung lượng dữ liệu */}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 80,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="pie-chart-outline" size={24} color="#0091FF" />
          </View>
          <View style={{ width: "70%", height: "75%" }}>
            <Text style={{ fontSize: 16, paddingBottom: 5 }}>
              Dung lượng dữ liệu
            </Text>
            <Text style={{ color: "gray", fontWeight: "medium" }}>
              Quản lý dữ liệu Zalo của bạn
            </Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Bộ nhớ */}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 80,
            marginBottom: 2,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="cloudy-outline" size={24} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Sao lưu và khôi phục</Text>
            <Text style={{ color: "gray", fontWeight: "medium" }}>
