          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Nhật ký*/}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <FontAwesomeIcons name="clock" size={22} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Nhật ký</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Danh bạ*/}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <FontAwesomeIcons name="address-book" size={22} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Danh bạ</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Giao diện và ngôn ngữ*/}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
            marginBottom: 2,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="color-palette-outline" size={22} color="#0091FF" />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Giao diện và ngôn ngữ</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Thông tin về Zalo*/}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons
              name="information-circle-outline"
              size={22}
              color="#0091FF"
            />
          </View>
          <View style={{ width: "70%" }}>
            <Text style={{ fontSize: 16 }}>Thông tin về Zalo</Text>
          </View>
          <Entypo name="chevron-small-right" size={24} color="#cccccc" />
        </Pressable>

        {/* Liên hệ hỗ trợ*/}
        <Pressable
          style={{
            backgroundColor: "white",
            flexDirection: "row",
            alignItems: "center",
            height: 60,
            marginBottom: 2,
          }}
        >
          <View style={{ width: "20%", alignItems: "center" }}>
            <Ionicons name="help-circle-outline" size={22} color="#0091FF" />
